import "../../css/pages/pages.css";
import { useEditProfile } from "../../hooks/user/useEditProfile";
export const ProfilePage = (props) => {
  const {
    targetWorkTime,
    targetWakeTime,
    targetBedTime,
    onChangeTargetWorkTime,
    onChangeTargetWakeTime,
    onChangeTargetBedTime,
    onEditTargetTime,
  } = useEditProfile();
  return (
    <section className="page">
      <div className="page-input-box">
        <h1>Profile Page</h1>
        <div className="profile-box">
          <span className="profile__text">TargetWorkTime: </span>
          <input
            value={targetWorkTime}
            type="number"
            className="profile__input profile__input-username"
            onChange={({ target: { value } }) => onChangeTargetWorkTime(value)}
          />

          <span className="profile-text">TargetWakeTime: </span>
          <input
            value={targetWakeTime}
            className="profile__input profile__input-email"
            type="number"
            onChange={({ target: { value } }) => onChangeTargetWakeTime(value)}
          />
          <span className="profile-text">TargetBedTime: </span>
          <input
            value={targetBedTime}
            type="number"
            className="profile__input profile__input-password"
            onChange={({ target: { value } }) => onChangeTargetBedTime(value)}
          />
          <button
            className="profile__btn profile__btn-login"
            onClick={onEditTargetTime}
          >
            Save
          </button>
        </div>
      </div>
    </section>
  );
};
